import React, { Suspense, useState, useCallback, useEffect } from 'react';
import { Canvas } from '@react-three/fiber';
import { Environment, OrbitControls, Plane, useGLTF } from '@react-three/drei';
import * as THREE from 'three';

const DetailedGround = React.memo(function DetailedGround() {
  const grassPatches = useCallback(() => 
    [...Array(50)].map((_, i) => {
      const x = Math.random() * 30 - 15;
      const z = Math.random() * 30 - 15;
      const scale = 0.3 + Math.random() * 0.3;
      return { x, z, scale, rotation: Math.random() * Math.PI };
    }), []
  );

  return (
    <group>
      <Plane
        receiveShadow
        rotation={[-Math.PI / 2, 0, 0]}
        position={[0, -0.1, 0]}
        args={[100, 100]}
      >
        <meshStandardMaterial
          color="#4CAF50"
          roughness={0.8}
          metalness={0.1}
        />
      </Plane>

      {grassPatches().map((patch, i) => (
        <mesh
          key={i}
          position={[patch.x, -0.05, patch.z]}
          rotation={[0, patch.rotation, 0]}
          scale={[patch.scale, patch.scale, patch.scale]}
        >
          <planeGeometry args={[0.3, 0.5]} />
          <meshStandardMaterial 
            color="#388E3C"
            side={THREE.DoubleSide}
            transparent
            opacity={0.7}
          />
        </mesh>
      ))}
    </group>
  );
});

function Model({ url }) {
  const gltf = useGLTF(url);

  useEffect(() => {
    if (gltf.scene) {
      const box = new THREE.Box3().setFromObject(gltf.scene);
      const center = box.getCenter(new THREE.Vector3());
      const size = box.getSize(new THREE.Vector3());

      const maxDim = Math.max(size.x, size.y, size.z);
      const scale = 5 / maxDim;

      gltf.scene.position.set(-center.x * scale, -box.min.y * scale, -center.z * scale);
      gltf.scene.scale.setScalar(scale);
    }
  }, [gltf]);

  return <primitive object={gltf.scene} />;
}

function ModelViewer({ modelUrl }) {
  const [isLoading, setIsLoading] = useState(true);
  const [isMobile, setIsMobile] = useState(false);

  useEffect(() => {
    setIsMobile(window.innerWidth <= 768);
    const handleResize = () => setIsMobile(window.innerWidth <= 768);
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const canvasRef = useCallback(node => {
    if (node !== null) {
      setIsLoading(false);
    }
  }, []);

  return (
    <div style={{ width: '100%', height: '100vh', position: 'relative', touchAction: 'none' }}>
      <Canvas
        ref={canvasRef}
        shadows
        camera={{ 
          position: isMobile ? [0, 2, 8] : [0, 5, 15],
          fov: 50,
          near: 0.1,
          far: 1000
        }}
        performance={{ min: 0.5 }}
        dpr={[1, 2]}
      >
        <Suspense fallback={null}>
          <Model url={modelUrl} />
          <DetailedGround />
          <Environment preset="sunset" />
          <OrbitControls 
            enableDamping={true}
            dampingFactor={0.05}
            maxPolarAngle={Math.PI * 0.65}
            minPolarAngle={0}
            minDistance={3}
            maxDistance={20}
            enableZoom={true}
            enablePan={false}
            rotateSpeed={0.5}
            target={[0, 1, 0]}
          />
          <ambientLight intensity={0.5} />
          <directionalLight
            position={[10, 10, 5]}
            intensity={1}
            castShadow
          />
        </Suspense>
      </Canvas>

      {isLoading && (
        <div style={{ 
          position: 'absolute', 
          top: '50%', 
          left: '50%', 
          transform: 'translate(-50%, -50%)',
          background: 'rgba(0, 0, 0, 0.7)',
          color: 'white',
          padding: '1rem 2rem',
          borderRadius: '8px'
        }}>
          Loading...
        </div>
      )}

      {isMobile && (
        <div style={{
          position: 'absolute',
          bottom: 20,
          left: '50%',
          transform: 'translateX(-50%)',
          background: 'rgba(0, 0, 0, 0.7)',
          color: 'white',
          padding: '0.5rem 1rem',
          borderRadius: '8px',
          fontSize: '0.9rem',
          textAlign: 'center',
          pointerEvents: 'none'
        }}>
          Use dois dedos para zoom â€¢ Arraste para girar
        </div>
      )}
    </div>
  );
}

export default ModelViewer;
